def pp(d, q, L):
    q1, q2, q3, q4, q5, q6 = q
    L1, L2, L3 = L
    return np.array([-d * sin(q1), d * cos(q1)])

def pm(d, q, L):
    q1, q2, q3, q4, q5, q6 = q
    L1, L2, L3 = L
    return np.array([- d * sin(q1 + q2) - L1 * sin(q1), d * cos(q1 + q2) + L1 * cos(q1)])

def pd(d, q, L):
    q1, q2, q3, q4, q5, q6 = q
    L1, L2, L3 = L
    return np.array([- L2 * sin(q1 + q2) - L1 * sin(q1) - d * sin(q1 + q2 + q3),
                     L2 * cos(q1 + q2) + L1 * cos(q1) + d * cos(q1 + q2 + q3)])

def hp(d, q, L, obs_x, obs_y):
    q1, q2, q3, q4, q5, q6 = q
    L1, L2, L3 = L
    return (obs_y - d*cos(q1))**2 - r**2 + (obs_x + d*sin(q1))**2

def hm(d, q, L, obs_x, obs_y):
    q1, q2, q3, q4, q5, q6 = q
